function hamburger(){var e=document.getElementById("menu-links");"block"===e.style.display?e.style.display="none":e.style.display="block"}function stadiumSwitcher(){var e=document.querySelectorAll(".mobile-visible"),l=document.querySelectorAll(".mobile-hidden");e.forEach(e=>{e.classList.remove("mobile-visible"),e.classList.add("mobile-hidden")}),l.forEach(e=>{e.classList.remove("mobile-hidden"),e.classList.add("mobile-visible")});var i=document.querySelectorAll(".highlighted"),s=document.querySelectorAll(".unhighlighted");i.forEach(e=>{e.classList.remove("highlighted"),e.classList.add("unhighlighted")}),s.forEach(e=>{e.classList.remove("unhighlighted"),e.classList.add("highlighted")})}